import { Container, Movie, MovieList } from "./styles"



function Home() {

  const movies = [ 
    {
      id: 1,
      title: "Spider-Man",
      image_url: "https://filmecompleto.com.br/wp-content/uploads/2020/10/MV5BMjMyOTM4MDMxNV5BMl5BanBnXkFtZTcwNjIyNzExOA@@._V1_.jpg"
    },
    {
      id: 2,
      title: "Spider-Man",
      image_url: "https://filmecompleto.com.br/wp-content/uploads/2020/10/MV5BMjMyOTM4MDMxNV5BMl5BanBnXkFtZTcwNjIyNzExOA@@._V1_.jpg"
    },
    {
      id: 3,
      title: "Spider-Man",
      image_url: "https://filmecompleto.com.br/wp-content/uploads/2020/10/MV5BMjMyOTM4MDMxNV5BMl5BanBnXkFtZTcwNjIyNzExOA@@._V1_.jpg"
    }
  ]


  return (

    <Container>
      <h1>Movies</h1>
      <MovieList>
      {movies.map(movie=>{
        return(
          <Movie>
            <a href="#"><img src={movie.image_url}></img></a>
            <span>{movie.title}</span>
            </Movie>
          )
        })}

        </MovieList>
    </Container>)}

      export default Home
